    [],nt"num_tags": 5,nt"name": "brigantine-national-wildlife-refuge-annual-narrative-report-calendar-year-1983",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Brigantine
    National Wildlife Refuge outlines Refuge accomplishments during the 1983 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses public participation, compliance
    with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, forests, grasslands, fire management, and pest control.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, animal control, and marking and bird banding. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment replacement, and communication systems. Cooperative programs
    and items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
